write a Python program to print out the first 100 prime numbers
Here is one way you could write such a program in Python:
```python
def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True
# Define a list of prime numbers up to the first million
primes = [2]
for i in range(3, 1000001//6+1):
    is_prime(i) and primes.append(i)
print("The first", len(primes), "prime numbers are:")
for p in primes[:10]:
    print(p)
